import React from "react";

const ReactToPost = ({ postId, symbol, onReactToPost }) => {
  const handleReact = () => {
    onReactToPost(postId, symbol);
  };

  return <button onClick={handleReact}>{symbol}</button>;
};

export default ReactToPost;
